// 测试 CommonConcatStr 公共方法拼接返回str功能
func TestCommonConcatStr(t *testing.T) {
	nodeExporterBuildInfoTest := map[string]string{
		"branch":    "HEAD",
		"goversion": "go1.19.3",
		"revision":  "1b48970ffcf5630534fb00bb0687d73c66d1c959",
		"version":   "1.5.0",
	}
	nodeUnameInfoTest := map[string]string{
		"domainname": "(none)",
		"machine":    "x86_64",
		"nodename":   "622466b5bd31",
		"release":    "5.4.0-109-generic",
		"sysname":    "Linux",
		"version":    "#123-Ubuntu SMP Fri Apr 8 09:10:54 UTC 2022",
	}
	nodeOsINfoTest := map[string]string{}
	log.Println("TestCommonConcatStr start")
	endMsg1 := CommonConcatStr(nodeExporterBuildInfoTest, "  node_exporter_build_info:\n")
	endMsg2 := CommonConcatStr(nodeUnameInfoTest, "  node_uname_info:\n")
	endMsg3 := CommonConcatStr(nodeOsINfoTest, "  node_os_info:\n")
	// check the result
	if endMsg1 == "" || endMsg2 == "" || endMsg3 != "" {
		t.Error("接收返回值错误")
	}
	log.Println("TestCommonConcatStr end")
}

